## Type of Change

feature or bug fix or documentation or others: Feature
API changed or not: YES (`model_eval`)
add a new struct for batch inference:
```c++
struct model_input {
  // embd or next token
  model_token* tokens = nullptr;
  // tokens length
  uint32_t n_tokens = 0;
  // prompt length
  uint32_t n_prompt_tokens = 0;
  // kv cache n_past
  uint32_t n_past = 0;
  // text tokens length (prompt + all next tokens)
  // the number of tokens evaluated so far (including evicted tokens if there is any)
  uint32_t n_total = 0;
  // request id
  int request_idx = -1;
  // beam id in beam search
  int beam_idx = 0;
  // padding related, attention mask
  // (0: left, 1: right)
  // only support padding left in decoder only model
  int padding_side = 0;
  // padding length
  uint32_t n_padding = 0;
};

MODEL_API int model_eval(struct model_context* ctx, const model_input* inputs, const int n_input, int n_threads););
```
